class About extends Component {
  state = {};
  render() {
    return (
      <div>
        <h1>About</h1>

        <h2>Hi, my Victor Nestor</h2>
        <body>
          I am a student at Brooklyn College, and this is my senior project for
          my 4900 class. <br />I chose to make a simple stock market web
          application using <a href="https://reactjs.org/">React</a> <br />
          <ul>
            <h3>Tools and Resources</h3>
            <li>
              {" "}
              Stock market data provided by{" "}
              <a href="https://iexcloud.io/">IEX Cloud</a>
            </li>
            <li>
              {" "}
              Stock market news provided by{" "}
              <a href="https://stocknewsapi.com/">Stock News API</a>
            </li>
            <li>
              <a href="https://www.getpostman.com/">Postman</a>
            </li>
            <li />
            <li />
            <li />
          </ul>
        </body>
      </div>
    );
  }
}

export default About;
